== GLPK for Windows ==

The third-party [http://winglpk.sourceforge.net GLPK for Windows] (winglpk) project regularly releases pre-compiled Windows executables, based on the official GLPK source files.  Executables for both 32-bit and 64-bit operating systems are available. Administrator rights are ''not'' needed.  The GLPK for Windows distribution also includes [[GLPK/Java#GLPK_for_Java|GLPK for Java]], which provides a binding to the [[w:Java (programming language)|Java]] programming language.

This project is active and updated executables usually follow an official GLPK release by only a few days. This is the best option for Windows users who do not wish to build and install GLPK by hand.

After downloading the archive from Sourceforge, please, calculate the MD5 and the SHA1 check sums and compare them to the values provided by Sourceforge. You can use Microsoft's [http://support.microsoft.com/kb/841290 File Checksum Integrity Verifier utility]<ref>{{cite web
| url         = http://support.microsoft.com/kb/841290
| title       = Availability and description of the File Checksum Integrity Verifier utility
| month       = 2011
| accessdate  = 2011-09-24
| publisher   = Microsoft
}}
</ref> for this purpose, e.g.
<pre>
fciv.exe -both winglpk-4.47.zip
</pre>

The downloaded archive has to be extracted. This can be done with 7-zip available at [http://www.7-zip.org/ http://www.7-zip.org/]. You may move the extracted directory (glpk-4.47) to your favorite place e.g to "C:\program files\GLPK".

Directory w32 contains the 32bit binaries and w64 contains the 64bit binaries.

You will typically want to have the GLPK dynamic link library (glpk_4_47.dll) in the search path for binaries. Either change the environment <tt>PATH</tt> variable accordingly or copy glpk_4_47.dll to "C:\windows\system32\". Open the control center and type "environment" into the search field to find the control to set your environment variables.

This mid-2012 help list [http://lists.gnu.org/archive/html/help-glpk/2012-08/msg00018.html posting] contains PNG format screenshots for the settings described above in relation to the Microsoft [[w:Visual_studio|Visual Studio]] 2010 C++ [[w:Integrated_development_environment|IDE]] &mdash; users who prefer screenshots will find these images particularly helpful.

== Building a C program using the GLPK library ==
The following description describes how to build a first program using the GLPK library. A 32bit system is assumed.

* open Visual Studio Express 2010 C++
* create a new "Win32 Console Application"
* do not choose compiled headers
* open the Project Properties dialog:
* under Linker > Input > Additional Dependencies : add <tt>"C:\Program Files\GLPK\glpk-4.47\w32\glpk_4_47.lib"</tt>
* under Configuration Properties > VC++ Directories > Include directories : add <tt>"C:\Program Files\GLPK\glpk-4.47\src</code>

Enter the following code and then hit <tt>F5</tt> to compile and run the test:

<source lang="cpp">
#include <stdio.h>
#include <conio.h>
#include "glpk.h"

int main(int argc, char* argv[]) {
    printf ("GLPK version %s\n", glp_version());
    printf ("Press any key\n");
    while (!kbhit()){}
    getch();
    return 0;
}
</source>
The program will output the GLPK version, and wait for any key to be hit, e.g.
<pre>
GLPK version 4.47
Press any key
</pre>

If you were using precompiled headers <tt>test.cpp</tt> would be
<source lang="cpp">
#include "stdafx.h"
int main(int argc, char* argv[]) {
    printf ("GLPK version %s\n", glp_version());
    printf ("Press any key\n");
    while (!kbhit()){}
    getch();
    return 0;
}
</source>
And <tt>stdafx.h</tt> would be 
<source lang="cpp">
#pragma once
#include <stdio.h>
#include <conio.h>
#include "glpk.h"
</source>

